      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( NOT col0 BETWEEN NULL AND col1 ) OR NOT + 33 - - - col1 * - 38 + + 1 + + col1 + - col2 * col1 + + 23 + - col2 IS NULL;
  - name: tab0

outputs:
